import {
  createBrowserRouter,
  Outlet,
  RouterProvider,
} from "react-router-dom";

import "./style.scss"

function App() {
  const router = createBrowserRouter([
    {
      path: "/",
      element: <home />
    },
  ]);
  return (
    <div className="app">
      <div className="container">
        <RouterProvider router={router} />
      </div>
    </div>
  )
}

export default App;
